        private static Bitmap Base64ToBitmap(String base64String)
        {
            try
            {
                byte[] imageAsBytes = Convert.FromBase64String(base64String);
                using (var ms = new MemoryStream(imageAsBytes))
                {
                    Bitmap b1 = new Bitmap(ms);
                    Bitmap b2 = new Bitmap(b1, new Size(16,16));
                    return b2;
                }
            }
            catch (Exception)
            {
                return null;
            }
        }
    }
